var _hoisted_1 = /*#__PURE__*/(0,vue__WEBPACK_IMPORTED_MODULE_0__.createStaticVNode)("<section class=\"contact-img-area nu-blog\"><div class=\"container\"><div class=\"row\"><div class=\"col-md-12 text-center\"><div class=\"con-text\"><h2 class=\"page-title\">Privacy Policy</h2></div></div></div></div></section><section class=\"blog-area bd-area\"><div class=\"container\"><div class=\"row\"><div class=\"mx-auto col-xl-12 col-lg-12 col-md-12 col-12\"><div class=\"tb-post-item ma-nn\"><div class=\"tb-content7\"><div class=\"blog-desc\"><p>We value the trust you place in urbanstrick.com. Please read this Privacy Policy, which tells you what information we collect from users of the urbanstrick.com, how we use that information, and with whom we may share it. Unless defined in this Privacy Policy Conduct, terms capitalized but not defined herein are defined in the Terms &amp; Conditions. In this Privacy Policy Urbanstrick.com is referred to as &quot;<strong>we</strong>,&quot; &quot;<strong>us</strong>,&quot; or &quot;<strong>our</strong>&quot; and you the end user are referred to as &quot;<strong>you</strong>&quot;, &quot;<strong>your</strong>&quot; or “<strong>user</strong>”.</p><p><br><strong>How Personal Information Is Collected and Updated</strong></p><p>We may collect information that personally identifies you when you register, when you participate in reviews and other features or when you otherwise communicate with us.</p><p><br><strong>Types of Personal Information Collected</strong></p><ul><li>We may collect the following types of information at the Urbanstrick.com:</li></ul><ol start=\"1\"><li>When you register at any of the Urbanstrick.com, we may request the following personal information:</li></ol><p><strong>(i)</strong> Your name and email address </p><ul></ul><ol start=\"2\"><li>When you search anything on the website, your keywords will be collected in a protected location for improving our search results.</li></ol><p><br><strong>How Information Is Used and Shared</strong></p><p><strong>Communications:</strong> We may send you communications about updates, and new services from time to time. If you do not want to receive these communications you can opt out by sending an email to <span style=\"color:#2b00ff;\"><a href=\"mailto:hello@urbanstrick.com\" style=\"color:#2b00ff;\" aria-describedby=\"a11y-external-message\">hello@urbanstrick.com</a> </span></p><p><strong>Processing Payments:</strong> For credit card purchasers, we redirect to the relevant financial institution for online transaction and billing information. </p><p><strong>Legal Requirements:</strong> Urbanstrick.com reserves the right to disclose your personal information as necessary to:<br><br><strong>(1)</strong> Comply with the law or comply with legal process served on Urbanstrick.com.<br><br><strong>(2)</strong> Protect and defend the rights or property of Urbanstrick.com.<br><br><strong>(3) </strong>Protect the personal safety of other Urbanstrick.com users or the public <br><br><strong>(4)</strong> To ensure compliance with our Terms &amp; Conditions. Urbanstrick.com co-operates with law enforcement and other third parties to enforce laws, intellectual property, and other rights, and we reserve the right to report any information related to suspicion of illegal activity to law enforcement for prosecution.</p><p><br><strong>Third Parties</strong></p><p>Except as described in this Privacy Policy, we will not disclose your personal information to third parties. Urbanstrick.com may, however, use for its own purposes, aggregate information that does not identify you personally, or share aggregate information about our users with advertisers, business partners, sponsors, and other third parties.</p><p><br><strong>Business Transfers</strong></p><p>Information about Urbanstrick.com users, including personal information, may be disclosed as part of any merger, acquisition, debt financing, sale of company assets, as well as in the event of an insolvency, bankruptcy or receivership in which personal information could be transferred to third parties as one of the business assets of Urbanstrick.com.</p><p><br><strong>Non-personal User Information</strong></p><p>An IP address is a number that is automatically assigned to your computer whenever you&#39;re surfing the Internet. When you request pages from Urbanstrick.com, our servers log your computer&#39;s IP address. Urbanstrick.com collects these IP addresses for the sole purpose of identifying our users&#39; service providers (whether yahoo, hotmail, Gmail etc.) so we can better develop our offerings at the Urbanstrick.com. We do not automatically link IP addresses to anything personally identifiable, however we can and will use IP addresses to identify users when we feel it is necessary to:</p><p><strong>(1)</strong> Comply with the law or comply with legal process served on Urbanstrick.com.com<strong></strong></p><p><strong>(2)</strong> Protect and defend the rights or property of Urbanstrick.com.com</p><p><strong>(3)</strong> Protect the personal safety of other Urbanstrick.com users or the public</p><p><strong>(4)</strong> To ensure compliance with our Terms &amp; Conditions.</p><p><br><strong>Cookies</strong></p><p>A cookie is a small packet of information that we place on your computer&#39;s hard drive whenever you visit the Urbanstrick.com. For each user, our web server automatically recognizes the following: </p><ul><li>The host origin of the request (e.g., your IP address)</li><li>The referrer (e.g., where you came from if you arrived at our site via a link)</li><li>The requested document (e.g., the page being viewed)</li><li>your browser type (e.g., Internet Explorer 6.0)</li><li>platform information (e.g., Windows 2000, Windows XP, MAC OS 10)</li><li>session data (e.g., whether login was successful) </li></ul><p>Urbanstrick.com uses cookies for a variety of reasons, including without limitation the following: </p><ul><li>For session variables, to facilitate your navigation of content on the Urbanstrick.com.</li><li>To determine if cookies are enabled in your browser so that we may ensure that our Urbanstrick.com run on your computer.</li><li>To authenticate your access to content on the Urbanstrick.com. </li></ul><p>We do not store in cookies any passwords or credit card information, any information that personally identifies you.</p><p><br><strong>Compliance with the Information Technology (Reasonable Security Practices and Procedures and Sensitive Personal Data or Information) Rules, 2011</strong></p><p>1. We provide you the opportunity to expressly signify your consent to the terms of our Privacy Policy through an opt in mechanism. You can also withdraw your consent earlier provided at any time subsequently by providing us written intimation of your intent to do so.</p><p>2. We collect your information for a lawful purpose connected with the successful conduct of our business for which such collection of information is necessary.</p><p>3. We do not retain your information for longer than is required for the purposes for which we collected the information.</p><p>4. We use collected information for the purpose for which it was collected and for nothing else.</p><p>5. If you have provided us information that is inaccurate or incomplete and want the same to be corrected or updated, please let us know in writing and we shall do the needful to the extent the same is feasible.</p><p>6. Your information is secure with us as we have robust security practices and standards at par with industry standards.</p><p>For redressal of your grievances, please find particulars of the Grievance Officer at <a href=\"mailto:customer.care@urbanstrick.com\" aria-describedby=\"a11y-external-message\">customer.care@urbanstrick.com</a> .</p><p><br><strong>Steps You Can Take to Protect Your Privacy</strong></p><p><strong>Links to Other Websites:</strong> You should be aware that when you are on any Urbanstrick.com website, you could be directed to other websites hosted by third parties. We do not endorse those websites. For example, if you &quot;click&quot; a link to a third party site we have listed on one of the pages on the Urbanstrick.com, the &quot;click&quot; takes you off the applicable Urbanstrick.com. Urbanstrick.com is not responsible for the content or information collection practices of these websites. Please note that these websites may have privacy policies that differ from this Privacy Policy. We encourage you to review and understand their privacy practices before providing them with information. </p><p><strong>What You Disclose:</strong> Please take appropriate precautions not to reveal your personal information while interacting with other users on Urbanstrick.com. Please keep in mind that whenever you give out personal information online - for example, via Urbanstrick.com review feature - that information can be viewed and used by people that you do not know, including but not limited to other users who access at the Urbanstrick.com. </p><p><strong>Passwords:</strong>Your access to your account is password-protected and only you are authorized to access it and view the information relevant to the account. You agree not to share your passwords with anyone. You are responsible for maintaining the secrecy of your passwords. You agree to sign off from the Urbanstrick.com and close your Internet browser window when you have finished accessing and using any website.</p><p>No Guarantee of Security. No data transmission over the Internet is guaranteed to be secure. Urbanstrick.com does not ensure or warrant the security of any personal or other information you transmit to us including without limitation via the Urbanstrick.com.</p><p><br><strong>Miscellaneous Privacy Issues</strong></p><p><strong>Children:</strong> Minors under the age of 18 may not use the website. We do not collect or maintain information from anyone known to be under the age of 18, and no part of the website is designed to attract anyone under the age of 18. Urbanstrick.com does not sell products for purchase by children. In certain instances, we sell children&#39;s products for purchase by adults. If you are under 18, you may use Urbanstrick.com only with the involvement of a parent or guardian.</p><p><strong>Public Areas:</strong>We may provide areas on our website where you can publicly post information about yourself, can communicate with others, or can review products and submit media content. This information may be accessible by other consumers or companies and may appear on other websites or web searches, and therefore this information could be read, collected, and used by others. For example, if you post your email address along with a product review, you may receive unsolicited messages. We have no control over who reads your postings or what other users may do with the information you voluntarily post, so please use caution when posting any personal information.</p><p><br><strong>Contact Information</strong></p><p>If you have questions or concerns regarding this Privacy Policy; please contact our support at <a href=\"mailto:hello@urbanstrick.com\" title=\"hello@urbanstrick.com\" aria-describedby=\"a11y-external-message\">hello@urbanstrick.com</a></p></div></div></div></div></div></div></section>", 2);

